import React from 'react';
import "./body.css";

export default function Body() {
  return (
    <div>
      <div className="adminBody">

        <div className="textBox">
            <div className="desc">Number of total results on the site : </div>
        </div>

        <div className="iconBox"></div>
      </div>
    </div>
  )
}
